create table phpbb_migrations
(
    migration_name        VARCHAR(255)     default ''  not null
        primary key,
    migration_depends_on  TEXT(65535)      default ''  not null,
    migration_schema_done INTEGER UNSIGNED default '0' not null,
    migration_data_done   INTEGER UNSIGNED default '0' not null,
    migration_data_state  TEXT(65535)      default ''  not null,
    migration_start_time  INTEGER UNSIGNED default '0' not null,
    migration_end_time    INTEGER UNSIGNED default '0' not null
);

